import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

function App(props) {

  const [count, setCount] = useState(0);

  return (
    <div className="App">
      <h1>
        Count = {count}
      </h1>
      <button onclick = {setCount(count + 1)}>
        +
      </button>      
      <button onclick = {setCount(count - 1)}>
        -
      </button>      
    </div>
  );
}

export default App;
